    H4 are for employees who spent less than 25% of their time engaged in activities
    in connection to any federal election. No employee of the Committee spent more
    than 25% of compensated time during any month within the reporting period engaged
    in Federal Election Activity. The fundraising activity identified as Lincoln Day
    Dinner 2008 (03/08/2008) had a date postponement and actually occured in July
    2008.  The final receipts are still being received and the expense ratio will
    be adjusted at that time."
